INSERT INTO `rainlab_blog_posts` VALUES (1,1,'EP-Coming-Soon!','ep-coming-soon','Leo Qwest EP to be announced end of the year!','Leo Qwest EP to be announced end of the year!','2015-08-14 00:00:00',1,'2015-08-14 11:19:11','2015-08-14 11:19:32','<p>Leo Qwest EP to be announced end of the year!</p>'),(2,2,'Dreams Don\'t Pay The Bills','dreams-dont-pay-bills','','My EP Titled **\"Dreams Don\'t Pay The Bills\"** is coming soon.. \r\n\r\nIt is a 7 Track EP displaying the sounds of Leo Qwest. Further information will be released in the coming weeks, such as the cover art and a release date! It will be a FREE download. So look out maate!!  \r\n\r\nAll at **[www.leoqwest.com](http://www.leoqwest.com)**','2015-08-26 00:00:00',1,'2015-08-26 19:17:29','2015-09-09 14:32:04','<p>My EP Titled <strong>&quot;Dreams Don\'t Pay The Bills&quot;</strong> is coming soon.. </p>\n<p>It is a 7 Track EP displaying the sounds of Leo Qwest. Further information will be released in the coming weeks, such as the cover art and a release date! It will be a FREE download. So look out maate!!  </p>\n<p>All at <strong><a href=\"http://www.leoqwest.com\">www.leoqwest.com</a></strong></p>'),(3,1,'Leo Qwest logo unveiled!','leo-qwest-logo-unveiled','A glimpse into my life & a reflection of your own life.. \"Dreams Don\'t Pay The Bills\"','I am so pleased to anounce that the new logo for Leo Qwest has been completed! I must say it has been an adventure making this... So many emotions turned into art! \r\n\r\nA glimpse into my life & a reflection of your own life.. \"**Dreams Don\'t Pay The Bills**\". \r\n\r\nKeep an eye out for the logo turning up in future music videos.\r\n\r\nYes!! Yes!!! Yes!! maaaate!!!\r\n\r\n[- Leo Qwest](http://www.leoqwest.com)','2015-09-26 00:00:00',1,'2015-09-26 10:23:59','2015-09-26 10:27:14','<p>I am so pleased to anounce that the new logo for Leo Qwest has been completed! I must say it has been an adventure making this... So many emotions turned into art! </p>\n<p>A glimpse into my life &amp; a reflection of your own life.. &quot;<strong>Dreams Don\'t Pay The Bills</strong>&quot;. </p>\n<p>Keep an eye out for the logo turning up in future music videos.</p>\n<p>Yes!! Yes!!! Yes!! maaaate!!!</p>\n<p><a href=\"http://www.leoqwest.com\">- Leo Qwest</a></p>'),(4,2,'NEW TRACK!! Running Thin','new-track-running-thin','','RUNNING THIN - vvvvvv Soundcloud Link below vvvvvv\r\n\r\nhttps://soundcloud.com/leo-qwest/running-thin\r\n\r\n[- Leo Qwest](http://www.leoqwest.com)','2015-09-29 00:00:00',1,'2015-09-29 15:11:15','2015-09-29 16:20:58','<p>RUNNING THIN - vvvvvv Soundcloud Link below vvvvvv</p>\n<p><a href=\"https://soundcloud.com/leo-qwest/running-thin\">https://soundcloud.com/leo-qwest/running-thin</a></p>\n<p><a href=\"http://www.leoqwest.com\">- Leo Qwest</a></p>'),(5,2,'Whites LIVE performance','whites-live-performance','','Hello my fellow music lovers! I will be doing a special LIVE gig at Whites Headingley Leeds! On 31st October (Halloween) this month.. I will be performing most songs from my project \"Dreams Don\'t Pay The Bills\" If your in Leeds come join!! if you\'re doing the Otley Run!! Come join!!!  If you are wanting to hear some new music.. Come join!!\r\n\r\n![WHITES POSTER](/themes/jacoweb-freelance/assets/images/lqwhitesposteredit.png)','2015-10-05 00:00:00',1,'2015-10-05 15:23:42','2015-10-22 07:55:46','<p>Hello my fellow music lovers! I will be doing a special LIVE gig at Whites Headingley Leeds! On 31st October (Halloween) this month.. I will be performing most songs from my project &quot;Dreams Don\'t Pay The Bills&quot; If your in Leeds come join!! if you\'re doing the Otley Run!! Come join!!!  If you are wanting to hear some new music.. Come join!!</p>\n<p><img src=\"/themes/jacoweb-freelance/assets/images/lqwhitesposteredit.png\" alt=\"WHITES POSTER\" /></p>'),(6,2,'My EP/Album DOWNLOAD HERE!!','my-epalbum-out-now','','ANNOUNCEMENT!!  My New 8 track EP/Album \"Dreams Don\'t Pay The Bills\" is now available for download! Enjoy maaate! \r\n\r\nDownload the album here: [www.leoqwest.bandcamp.com/releases](https://leoqwest.bandcamp.com/releases)\r\n\r\n\r\n\r\n![ghosttown.png](/storage/app/uploads/public/565/b3d/610/565b3d610aa94596345084.png)\r\n\r\n[Dreams Don\'t Pay The Bills](https://leoqwest.bandcamp.com/releases)','2015-11-28 00:00:00',1,'2015-11-28 21:16:38','2015-11-29 18:07:12','<p>ANNOUNCEMENT!!  My New 8 track EP/Album &quot;Dreams Don\'t Pay The Bills&quot; is now available for download! Enjoy maaate! </p>\n<p>Download the album here: <a href=\"https://leoqwest.bandcamp.com/releases\">www.leoqwest.bandcamp.com/releases</a></p>\n<p><img src=\"/storage/app/uploads/public/565/b3d/610/565b3d610aa94596345084.png\" alt=\"ghosttown.png\" /></p>\n<p><a href=\"https://leoqwest.bandcamp.com/releases\">Dreams Don\'t Pay The Bills</a></p>'),(7,2,'FRESH HYPE review Leo Qwest.','fresh-hype-review-leo-qwest','','A review of Leo Qwest written by the Fresh Hype team.\r\n\r\n![565b3d610aa94596345084.png](/storage/app/uploads/public/56a/0fb/ea8/56a0fbea8f028894987594.png)\r\n\r\n\r\n\r\n\r\n[https://firstplaymusic.wordpress.com/2015/05/24/fresh-hype-leo-qwest-being-myself/](http://)','2016-01-22 00:00:00',1,'2016-01-21 15:41:01','2016-01-21 15:41:49','<p>A review of Leo Qwest written by the Fresh Hype team.</p>\n<p><img src=\"/storage/app/uploads/public/56a/0fb/ea8/56a0fbea8f028894987594.png\" alt=\"565b3d610aa94596345084.png\" /></p>\n<p><a href=\"http://\"><a href=\"https://firstplaymusic.wordpress.com/2015/05/24/fresh-hype-leo-qwest-being-myself/\">https://firstplaymusic.wordpress.com/2015/05/24/fresh-hype-leo-qwest-being-myself/</a></a></p>');
